import { StatusBar } from "expo-status-bar";
import React from "react";
import { StyleSheet, Text, View, TouchableOpacity } from "react-native";
import colors from "./constants/colors";
import InfoTextScreen from "./screens/InfoTextScreen";
import LogoScreen from "./screens/LogoScreen";
import ChoosePwScreen from "./screens/ChoosePwScreen";
import CalendarScreen from "./screens/CalendarScreen";
import MensCycleScreen from "./screens/MensCycleScreen";
import SettingsScreen from "./screens/SettingsScreen";
import * as content from "./constants/texts";
import ChangePWScreen from "./screens/ChangePWScreen";
import IndexCal from "./screens/IndexCal";
import IndexCircle from "./screens/IndexCircle";
import LoginPWScreen from "./screens/LoginPWScreen";
import Paginator from "./components/Paginator";
/**
 * The MASTER APP.
 * We can do it! *peptalk*
 * Note: we still need an Navigation Component and the entire Logic
 *
 * @returns
 */
import { createMaterialTopTabNavigator } from "@react-navigation/material-top-tabs";

const Tab = createMaterialTopTabNavigator();
import { NavigationContainer } from "@react-navigation/native";

export default function App() {
  // let content = <LoginPWScreen onSavePin={selectedNumber} />;
  return (
    <NavigationContainer>
      {/* Rest of your app code */}
      <Tab.Navigator
        tabBarPosition={"bottom"}
        screenOptions={{
          tabBarShowLabel: false,
          indicatorStyle: {
            backgroundColor: "transparent",
          },
          tabBarIconStyle: {
            display: "flex",
            justifyContent: "center",
            alignItems: "center",
          },
          tabBarItemStyle: {
            //color of item-object
            backgroundColor: "#00ff00",
            width: "30",
            paddingHorizontal: "1px",
          },
          tabBarContentContainerStyle: {
            //total backgroundcolor of bar
            backgroundColor: "#ff0000",
            justifyContent: "center",
          },
        }}
      >
        <Tab.Screen
          name="Home"
          component={IndexCal}
          options={{
            tabBarIcon: ({ focused }) => (
              <View
                style={{
                  height: 10,
                  width: 10,
                  borderRadius: 10,
                  backgroundColor: focused ? "#493d8a" : "#748c94",
                }}
              />
            ),
            tabBarIconStyle: {
              display: "flex",
              alignItems: "flex-end",
              justifyContent: "center",
            },
          }}
        />
        <Tab.Screen
          name="Settings"
          component={SettingsScreen}
          options={{
            tabBarIcon: ({ focused }) => (
              <View
                style={{
                  height: 10,
                  width: 10,
                  borderRadius: 10,
                  backgroundColor: focused ? "#493d8a" : "#748c94",
                }}
              />
            ),
          }}
        />
        <Tab.Screen
          name="Seite3"
          component={ChoosePwScreen}
          options={{
            tabBarIcon: ({ focused }) => (
              <View
                style={{
                  height: 10,
                  width: 10,
                  borderRadius: 10,
                  backgroundColor: focused ? "#493d8a" : "#748c94",
                }}
              />
            ),
            tabBarIconStyle: {
              display: "flex",
              alignItems: "flex-start",
              justifyContent: "center",
            },
          }}
        />
      </Tab.Navigator>
    </NavigationContainer>
  );
}

const styles = StyleSheet.create({
  container: {
    backgroundColor: colors.mainLG,
    height: "100%",
  },
});

